import { Route, Switch, Link } from 'react-router-dom';
import Web from './Web'
import Form from './Form'
var element = data;

class Data extends React.Component {
    constructor() {
        super()
        this.state = {
            array: []
        }
    }
    componentDidMount() {
        element.map((emp) =>
        (
            this.setState({ array: emp })
        ))
    }

    render() {
        return (

            element.map((emp, i) =>
            (   <>
                <Switch>
                    <Route exact path='/' >
                        <div>
                            <div>{emp.id}</div>
                            <Link to={'/Web/' + emp.id} > {emp.title}</Link>

                            </div></Route>,
                </Switch>

                </>
            ),
            )

        )

    }
}
export default Data;
